import { useSelector } from "react-redux";

import Post from "./Post/Post";

const Posts = () => {
    const posts = useSelector(state => {
      state.posts;
    });


  return (
    <>
      {posts.map(post => {
        <div key={post.id}>
          <Post post={post} />
        </div>;
      })}
    </>
  );
};

export default Posts;
